import React, { Component } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import withNavigation from "./WithNavigation";
import withParams from "./WithParams";
import HeaderComponent from "./HeaderComponent";
import FooterComponent from "./FooterComponent";
import LoginComponent from "./LoginComponent";
import WelcomeComponent from "./WelcomeComponent";
import ErrorComponent from "./ErrorComponent";
import ListProgress from "./ListProgress";

class GymProgressApp extends Component {
    render() {
        const LoginComponentNavigation = withNavigation(LoginComponent);
        const WelcomeComponentParams = withParams(WelcomeComponent);
        return (
            <div className="GymProgressApp">
                <BrowserRouter>
                    <Routes>

                        <Route
                            path="/"
                            element={<LoginComponentNavigation />}
                        />
                        <Route
                            path="/login"
                            element={<LoginComponentNavigation />}
                        />
                        <Route
                            path="/welcome/:name"
                            element={<WelcomeComponentParams />}
                        />
                        <Route path="/progress" element={<ListProgress />} />
                        <Route path="*" element={<ErrorComponent />} />
                    </Routes>
                </BrowserRouter>
            </div>
        );
    }
}

export default GymProgressApp;
